import axios from 'axios';

export default class ReportDetails extends Component {
    constructor(props){
        super(props);

        this.state={
            lab:{}
        };
    }

    componentDidMount(){

        const id = this.props.match.params.id;

        axios.get(`/lab/${id}`).then((res) =>{
            if(res.data.success){
                this.setState({
                    post:res.data.lab
                });

                console.log(this.state.lab);

            }
        });
